import React from "react";

import './ListCity.css'

const listCity = [
  {
    "name": "Dublin",
    "subText": "123 properties",
    "image": "./images/city_1.webp"
  },
  {
    "name": "Reno",
    "subText": "533 properties",
    "image": "./images/city_2.webp"
  },
  {
    "name": "Austin",
    "subText": "532 properties",
    "image": "./images/city_3.webp"
  },
  // {
  //   "name": "Reno",
  //   "subText": "533 properties",
  //   "image": "./images/city_2.webp"
  // },
]



function ListCity() {
  return (
    <div className='container-listcity'>
      {listCity.map(city => (
        
          <div className=''>
            <h1>{city['name']}</h1>
            <h2>{city['subText']}</h2>
          </div>
        
      ))}
    </div>
  )
}


export default ListCity;
